function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <header className="App-header">
          <Route exact path="/" exact component={Recruit} />
          <Route exact path="/about/" component={About} />
          <Route exact path="/users/" component={Users} />
          <Route path="/conferences/" component={Conferences} />
        </header>
      </div>
    </Router>
  );
}

export default App;
